INSERT INTO `sys_log` VALUES ('8a4ad60a6a67b0fd016a6d0e27fd0325', '/portal/logical/saveResume', '添加', '{\"tlContent\":[\"<p><span>table 模块是我们的又一走心之作，在 layui 2.0 的版本中全新推出，是 layui 最核心的组成之一。它用于对表格进行一些列功能和动态化数据操作，涵盖了日常业务所涉及的几乎全部需求。支持固定表头、固定行、固定列左/列右，支持拖拽改变列宽度，支持排序，支持多级表头，支持单元格的自定义模板，支持对表格重载（比如搜索、条件筛选等），支持复选框，支持分页，支持单元格编辑等等一些列功能。尽管如此，我们仍将对其进行完善，在控制代码量和性能的前提下，不定期增加更多人性化功能。table 模块也将是 layui 重点维护的项目之一。</span></p>\"],\"reqId\":[\"F001\"]}', '2019-04-30 15:03:25', 'admin(管理员)', '数据日志', '127.0.0.1');
